import React from 'react';
import OverlayPortals from '../../Overlay/OverlayPortal';
import ReactDOM from 'react-dom';
import styles from './Notification.module.scss';
import { Button } from '@material-ui/core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faCheck} from '@fortawesome/free-solid-svg-icons'
const Notification = () =>{
    return(
        <>
        <div className={styles.notify}>
            <div className={styles.box}>
            <span></span><FontAwesomeIcon icon={faCheck}/>
            <p>Thay đổi thành công</p>
            <Button variant='contained' className={styles.btn}>Về lại trang chính</Button>
            </div>
        </div>
        {ReactDOM.createPortal(<OverlayPortals/>, document.getElementById('overlay'))}
        </>
    )
}

export default Notification;
